impl Solution {
    pub fn construct_product_matrix(grid: Vec<Vec<i32>>) -> Vec<Vec<i32>> {
        let n = grid.len();
        let m = grid[0].len();
        let mod_val = 12345;

        // Initialize the result matrix with ones
        let mut result = vec![vec![1; m]; n];

        // Compute row and column products separately to avoid direct division
        // This section is revised to focus on a viable approach within the problem's constraints
        for i in 0..n {
            for j in 0..m {
                let mut product = 1;
                // Multiply all elements except the ones in the current row and column
                for x in 0..n {
                    if x != i { // Skip current row
                        for y in 0..m {
                            product = (product * grid[x][y]) % mod_val;
                        }
                    }
                }
                for y in 0..m {
                    if y != j { // Skip current column and the current cell again
                        product = (product * grid[i][y]) % mod_val;
                    }
                }
                // Assign the computed product to the result matrix
                result[i][j] = product;
            }
        }

        result
    }
}
